def solution(stdin: str) -> str:
    width, height = [int(x) for x in stdin.split()]

    map_ = [[c for c in stdin.strip()] for _ in range(height)]

    def is_wall(x, y):
        return map_[y][x] == '#'

    def in_bounds(x, y):
        return 0 <= x < width and 0 <= y < height

    def has_gold(x, y):
        return map_[y][x] == 'G'

    def has_trap(x, y):
        return map_[y][x] == 'T'

    def walk(x, y, dx, dy):
        dx += x
        dy += y
        while in_bounds(dx, dy):
            if is_wall(dx, dy):
                dx -= x
                dy -= y
                continue
            elif has_gold(dx, dy):
                return True
            elif has_trap(dx, dy):
                return False

            dx += dx
            dy += dy
        return False

    player_x, player_y = [i for i, s in enumerate(map_[0]) if s == 'P'][0], 0
    gold_count = 0
    while True:
        if walk(player_x, player_y, 0, 1):
            gold_count += 1
        else:
            break
        player_y += 1
    return gold_count

