from collections import defaultdict
from collections import deque


class ProofLine:
    def __init__(self, assumptions, conclusion):
        self.assumptions = assumptions
        self.conclusion = conclusion

    def __str__(self):
        return "->".join([self.assumptions, self.conclusion])

    def is_valid(self):
        if len(self.assumptions) == 0:
            return self.conclusion in {'0', '1', '2', '3', '4', '5'}
        else:
            return all([assumption in {'0', '1', '2', '3', '4', '5'} for assumption in self.assumptions])

    def __eq__(self, other):
        return self.assumptions == other.assumptions and self.conclusion == other.conclusion

    def __hash__(self):
        return hash((self.assumptions, self.conclusion))


